import copy
import json
import math

from sqlalchemy import and_

from backend.openpipeAPI.ORM.ORM import ORM
from backend.openpipeAPI.ORM.TO import TO

orm = ORM()
tables = TO().getClasses()
MetaTags = tables["metaTag"]



stm = """select * from metaTag where metaDataId in (
select metaDataId from metaTag where tagName="openpipe_canonical_medium" and value='' and topic_id is null);"""

# join collectionMember on asset.id=assetId where collectionId=222

tagResultSet = orm.executeSelect(stm)
tags = {}

for t in tagResultSet["data"]:
    mid = t["metaDataId"][0]
    tagName = t["tagName"][0]
    value = t["value"][0]
    tagId = t['id'][0]
    if mid not in tags:
        tags[mid] = {tagName: {"value": value, "id": tagId}}
    else:
        tags[mid][tagName] = {"value": value, "id": tagId}

print("fetched data")
count = 0
updates = []
for tm in tags:
    # print(tm)
    t = tags[tm]
    # print(t)
    if 'openpipe_canonical_source' in t and "openpipe_canonical_medium" in t:
        if t['openpipe_canonical_source']["value"] == "Cleveland Museum of Art":
            updates.append({'id': t["openpipe_canonical_medium"]["id"], "value": t['technique']["value"]})
        else:
            print(t['openpipe_canonical_source']["value"])
    else:
        print("tag not there")

print(len(tags))
print(len(updates))
print(updates)
maps={}
topicMap={}

for u in updates:
    if u["value"] in maps:
        maps[u["value"].lower()].append(u)
    else:
        maps[u["value"].lower()]=[u]
print(len(maps))

resultSet=orm.session.query(MetaTags.value,MetaTags.topic_id)\
    .filter(MetaTags.tagName == 'openpipe_canonical_medium', MetaTags.value.in_(maps.keys()) )\
    .all()

for r in resultSet:
    if r[0].lower() in topicMap:
        if topicMap[r[0].lower()] == -1 :
            topicMap[r[0].lower()]=r[1]
    else:
        topicMap[r[0].lower()] = r[1]

topicUpdate=[]
print(topicMap)
for uu in updates:
    tid=-1
    if uu["value"].lower() in topicMap:
        tid = topicMap[uu["value"].lower()]

    uu["topic_id"] = tid
    uu["topic_name"] = "medium"
    uu["topic_code"] = "900"

    topicUpdate.append(uu)


print(topicUpdate)
print(len(topicUpdate))

orm.bulkUpdate(topicUpdate, MetaTags, 1000)

